import React, { Component } from "react";

export default class MainView extends Component {
    state = {
        posts : {}
    }

    componentDidMount(){
		fetch('http://localhost:3000/posts')
		.then(resp => resp.json())
		.then(data => {
			this.setState({
				posts: data
			},() => console.log(this.state.posts))
		})
	}

    render() {
		return(
			<div>Im a nav bar</div>
		)
	}
}
